import React, { useState } from 'react';
// @ts-ignore
import CategoriesPage from "./CategoriesPage.tsx";
// @ts-ignore
import ProductList from "./ProductList.tsx"
import { Routes, Route } from "react-router-dom";

const LibraryProducts = () => {
    const [productDataSelection, setProductDataSelection] = useState(window.location.pathname)
    function cardClicked(name:string, event){
        setProductDataSelection(name)
    }
    console.log(window.location.pathname)
    const [categoriesData, setCategoriesData] = React.useState([])
    async function getCategoriesData() {
        await fetch(`http://127.0.0.1:8000/api/productcategories/`)
        .then(response => response.json())
        .then(response=>{
            setCategoriesData(response)
        })
    }
    React.useEffect(()=>{
        getCategoriesData()
    },[])
    return(
        <>
        <Routes>
            <Route path="" 
                element={
                    <CategoriesPage
                        cardClicked={cardClicked}
                        categoriesData={categoriesData}
                    />
                }>
            </Route>
            <Route path={`/all-products`} 
                element={
                    <ProductList
                        productDataSelection = {productDataSelection}
                        categoriesData={categoriesData}
                    />
                }>
            </Route>
            <Route path={'/beauty'} 
                element={
                    <ProductList
                        productDataSelection = {productDataSelection}
                        categoriesData={categoriesData}
                    />
                }>
            </Route>
            <Route path={'/cooking'} 
                element={
                    <ProductList
                        productDataSelection = {productDataSelection}
                        categoriesData={categoriesData}
                    />
                }>
            </Route>
            <Route path={'/health'} 
                element={
                    <ProductList
                        productDataSelection = {productDataSelection}
                        categoriesData={categoriesData}
                    />
                }>
            </Route>
            <Route path={'/cleaning'} 
                element={
                    <ProductList
                        productDataSelection = {productDataSelection}
                        categoriesData={categoriesData}
                    />
                }>
            </Route>
            <Route path={'/electronics'} 
                element={
                    <ProductList
                        productDataSelection = {productDataSelection}
                        categoriesData={categoriesData}
                    />
                }>
            </Route>
        </Routes>
        </>
    )
}

export default LibraryProducts
